import React from 'react'
import { Avatar, Card, CardHeader} from '@mui/material';
import styled from '@emotion/styled';

const CardTwo = () => {

const DashBoardCard=styled(Card)`
height:100px;
width: 1176px;
margin:20px 55px;
border: 1px solid #0000001F;
border-radius:16px;
box-shadow:none;
display:flex;
`;
const EnrolledCard=styled(Card)`
width:391.33px
`;

// const UsersIconBox=styled('div')`
// height:52px;
// width:52px;
// background-color:#03A9F4;
// `;
const QuestionsCard=styled(Card)`
width:391.33px
`;
const AverageCard=styled(Card)`
width:391.33px
`;
  return (
   <>
     <DashBoardCard >
        <EnrolledCard>
        <CardHeader
        avatar={
          <Avatar sx={{ bgcolor:'#03A9F4'}} aria-label="recipe">
            R
          </Avatar>
        }
        action={
          <IconButton aria-label="settings">
            <MoreVertIcon />
          </IconButton>
        }
        title="Shrimp and Chorizo Paella"
        subheader="September 14, 2016"
      />
        </EnrolledCard>
        <QuestionsCard></QuestionsCard>
        <AverageCard></AverageCard>
     </DashBoardCard>
   </>
  )
}

export default CardTwo
